import { Injectable } from '@angular/core';
import {Clothing} from "../../commons/models/clothing.model";

@Injectable({
  providedIn: 'root'
})
export class ClothingService {

  constructor() { }

  public listClothings(): Clothing[] {
    return [new Clothing(1, 'Meias', 1.0, 1)]
    //return [];
  }
}
